[A, B] = complementary_codes(4);

% Subcomplementary Codes
% A = [1 -1 1 -1 1 -1 -1 1];
% B = [1 -1 1 -1 -1 1 1 -1];

RA = xcorr(A);
RB = xcorr(B);
R = RA + RB;

figure; %[output:4df0492a]
subplot(2,1,1) %[output:4df0492a]
stem(RA); %[output:4df0492a]
title('Individual Autocorr.') %[output:4df0492a]
hold on; %[output:4df0492a]
stem(RB); %[output:4df0492a]
legend('R_A','R_B') %[output:4df0492a]

subplot(2,1,2) %[output:4df0492a]
stem(R) %[output:4df0492a]
title('Autocorr. Sum') %[output:4df0492a]
legend('R_{sum}') %[output:4df0492a]
%%
prf = 1e3;
wavA = phased.PhaseCodedWaveform("Code","Custom","CustomCode",A,'PRF',prf,'SampleRate',1e5);
wavB = phased.PhaseCodedWaveform("Code","Custom","CustomCode",B,'PRF',prf,'SampleRate',1e5);

figure; ambgfun(wavA(),wavA.SampleRate,wavA.PRF,"Cut","Doppler","CutValue",0); colorbar; %[output:1f0a0f68]
figure; ambgfun(wavB(),wavB.SampleRate,wavB.PRF,"Cut","Doppler","CutValue",0); colorbar; %[output:808c5cb5]

comboWav = [wavA(); wavB()];
figure; ambgfun([wavA(); wavB()],wavA.SampleRate,wavA.PRF/2); colorbar; %[output:03f75f56]
figure; ambgfun([wavA(); wavB()],wavA.SampleRate,wavA.PRF/2,"Cut","Doppler","CutValue",0); colorbar; %[output:01b3ac39]
hold on; %[output:01b3ac39]
xline(1/wavA.PRF*1e3,'--') %[output:01b3ac39]
xline(-1/wavA.PRF*1e3,'--') %[output:01b3ac39]
%%
% Create Targets
dop = 0; %[control:spinner:0c14]{"position":[7,8]}

tgt1 = struct( ...
    'Position', [3e4 0 0], ...
    'Velocity', [-dop 0 0], ...
    'Signatures', {rcsSignature('Pattern',10)}); % Pattern is in dBsm

tgt2 = struct( ...
    'Position', [4e4 0 0], ...
    'Velocity', [-dop 0 0], ...
    'Signatures', {rcsSignature("Pattern",0)}); % Pattern is in dBsm

% Create the radar sensor
release(wavA)
release(wavB)
radar = radarTransceiver;
radar.ReceiveAntenna.Sensor = radar.ReceiveAntenna.Sensor.Element;
radar.Receiver.SampleRate = wavA.SampleRate;
%%
% Waveform A
radar.NumRepetitions = 64;
radar.Waveform = wavA;
rx = radar([tgt1,tgt2],0);

rangeDopProcessor = phased.RangeDopplerResponse('RangeMethod','Matched filter','DopplerOutput','Speed', ...
    'OperatingFrequency',radar.TransmitAntenna.OperatingFrequency,'SampleRate',wavA.SampleRate, ...
    'DopplerWindow','Hamming');
windowedMF = hamming(numel(A)).*wavA.getMatchedFilter();
[resp,rnggrid,dopgrid] = rangeDopProcessor(rx,windowedMF);
resp2Plot = mag2db(abs(resp(1:end-numel(A),:))');
figure; imagesc(rnggrid(1:end-numel(A)),dopgrid,resp2Plot); %[output:6fa54be9]
hold on; %[output:6fa54be9]
xline(norm(tgt1.Position)) %[output:6fa54be9]
xline(norm(tgt2.Position)) %[output:6fa54be9]
yline(dop) %[output:6fa54be9]
ylabel('Doppler (m/s)') %[output:6fa54be9]
xlabel('Range (m)') %[output:6fa54be9]
title('Waveform A Range-Doppler') %[output:6fa54be9]

WavARow = getMaxRow(resp2Plot);
%%
% Waveform B
release(radar)
radar.Waveform = wavB;
rx = radar([tgt1,tgt2],0);

rangeDopProcessor = phased.RangeDopplerResponse('RangeMethod','Matched filter','DopplerOutput','Speed', ...
    'OperatingFrequency',radar.TransmitAntenna.OperatingFrequency,'SampleRate',wavA.SampleRate, ...
    'DopplerWindow','Hamming');
windowedMF = hamming(numel(B)).*wavB.getMatchedFilter();
[resp,rnggrid,dopgrid] = rangeDopProcessor(rx,windowedMF);
resp2Plot = mag2db(abs(resp(1:end-numel(B),:))');
figure; imagesc(rnggrid(1:end-numel(B)),dopgrid,resp2Plot); %[output:332e54d2]
hold on; %[output:332e54d2]
xline(norm(tgt1.Position)) %[output:332e54d2]
xline(norm(tgt2.Position)) %[output:332e54d2]
yline(dop) %[output:332e54d2]
ylabel('Doppler (m/s)')
xlabel('Range (m)') %[output:332e54d2]
title('Waveform B Range-Doppler') %[output:332e54d2]

WavBRow = getMaxRow(resp2Plot);
%%
% Complimentary WFM
release(radar)
radar.NumRepetitions = 1; % Number of chirps
mfilterA = phased.MatchedFilter('Coefficients',wavA.getMatchedFilter);
mfilterB = phased.MatchedFilter('Coefficients',wavB.getMatchedFilter);

mfilters = {mfilterA,mfilterB};
waveforms = {wavA,wavB};

fullFrame = [];
t = 0;
for nPair = 1:64
    for ii = 1:2
        release(radar)
        radar.Waveform = waveforms{ii};
        outChirp = radar([tgt1,tgt2],t);
        mfilter = mfilters{ii};
        outMF = mfilter(outChirp);
        outMF = outMF(length(A)+1:end);
        t = t + 1/radar.Waveform.PRF;
        fullFrame = [fullFrame,outMF];

        tgt1.Position = tgt1.Position + tgt1.Velocity*1/radar.Waveform.PRF;
        tgt2.Position = tgt2.Position + tgt2.Velocity*1/radar.Waveform.PRF;
    end
end
fullFrame = fullFrame.';
lambda = freq2wavelen(radar.ReceiveAntenna.OperatingFrequency);

% Add pairs of pulses
fullFrame = fullFrame(1:2:end,:) + fullFrame(2:2:end,:);
nPulse = 64;
fD = (-nPulse/2 : nPulse/2-1) * (prf/2 / nPulse);

v = fD*lambda/2 ;
rangeRes = bw2rangeres(wavA.bandwidth);
rangeBins = rangeRes*(1:size(fullFrame,2));



dopWindow = hamming(64);
fullFrame = fullFrame .* dopWindow;
rdm = fftshift(fft(fullFrame,[],1),1);
rdmPlot = mag2db(abs(rdm));
figure; imagesc(rangeBins,v,rdmPlot); %[output:0d8db674]
hold on; %[output:0d8db674]
xline(norm(tgt1.Position)) %[output:0d8db674]
xline(norm(tgt2.Position)) %[output:0d8db674]
yline(dop) %[output:0d8db674]
ylabel('Doppler (m/s)')
xlabel('Range (m)') %[output:0d8db674]
title('Complementary Codes') %[output:0d8db674]

WavCRow = getMaxRow(rdmPlot);
%%
figure; %[output:2472b03a]
plot(WavARow,'LineWidth',1,'DisplayName','A'); %[output:2472b03a]
hold on; %[output:2472b03a]
plot(WavBRow,'LineWidth',1,'DisplayName','B'); %[output:2472b03a]
plot(circshift(WavCRow,1),'LineWidth',2,'DisplayName','Comlementary'); %[output:2472b03a]
title('Doppler Slice of Range-Doppler Map') %[output:2472b03a]
legend('Location','northeast') %[output:2472b03a]
%%
function [A, B] = complementary_codes(n)
% COMPLEMENTARY_CODES Generate 1D Golay complementary code pair
%   [A, B] = COMPLEMENTARY_CODES(N) returns the Nth-order 1D complementary
%   sequences A and B using recursive construction.
%
%   Example:
%       [A, B] = complementary_codes(3)

    % Base case
    A = [1 1];
    B = [1 -1];

    % Recursive construction for 1D sequences
    for k = 2:n
        A_new = [A,  B];
        B_new = [A, -B];
        A = A_new;
        B = B_new;
    end
end

function row = getMaxRow(mat)
    rowMaxes = max(mat, [], 2);   % max of each row
    [~, rowIdx] = max(rowMaxes);
    
    row = mat(rowIdx, :);
end

